var
  space: chipmunk.Space
  particle_count = 0


proc make_ball(x: chipmunk.Float; y: chipmunk.Float): chipmunk.Shape = 
    var body: chipmunk.Body = newBody(1.0, INF)
    body.position = chipmunk.Vect(x: x, y: y)
    result = newCircleShape(body, 0.95, chipmunk.vzero)
    result.elasticity = 0.0
    result.friction = 0.0
    
proc init_space() =
    space = chipmunk.newSpace()
    space.iterations = 1
    
    # The space will contain a very large number of similary sized objects.
    # This is the perfect candidate for using the spatial hash.
    # Generally you will never need to do this.
    space.useSpatialHash(2.0, 10000.cint)
    
    particle_count = 0
    
    var 
        body: chipmunk.Body
        shape: chipmunk.Shape
    
    # Nim-Chipmunk logo
    for pair in NIM_CHIPMUNK_BITMAP:
        shape = make_ball(
           (960/2) - (IMAGE_WIDTH/2) + float(pair.x), # Offset the image
           (540/3) + (IMAGE_HEIGHT/2) + float(pair.y) # Offset the image
        )
        discard space.addBody(shape.body())
        discard space.addShape(shape)
        
        inc(particle_count)
    
    # Bullet that smashes "Nim"
    body = space.addBody(chipmunk.newBody(1e9, INF))
    body.position = chipmunk.Vect(
        x: (960/2) - 930.0, 
        y: (540/3) + 20.0
    )
    body.velocity = chipmunk.Vect(x: 400.0, y: 0.0)

    shape = space.addShape(chipmunk.newCircleShape(body, 8.0f, chipmunk.vzero))
    shape.elasticity = 0.0
    shape.friction = 0.0
    shape.filter = NOT_GRABBABLE_FILTER
    
    # Bullet that smashes "Chipmunk"
    body = space.addBody(chipmunk.newBody(1e9, INF))
    body.position = chipmunk.Vect(
        x: (960/2) - 1000.0, 
        y: (540/3) - 40.0
    )
    body.velocity = chipmunk.Vect(x: 400.0, y: 0.0)

    shape = space.addShape(chipmunk.newCircleShape(body, 8.0f, chipmunk.vzero))
    shape.elasticity = 0.0
    shape.friction = 0.0
    shape.filter = NOT_GRABBABLE_FILTER
    
    inc(particle_count)

type
  App = ref object
    eventHandler: AppEventHandler
    batch: SpriteBatch
    camera: Camera
    assetIds: Table[string, Hash]

var tex: Texture

proc resize*(e: EventArgs) =
  let event = SDLEventMessage(e).event
  let sdlEventData = event.sdlEventData
  
  let app = cast[App](event.userData)
  
  let w = sdlEventData.window.data1.float
  let h = sdlEventData.window.data2.float

  app.camera.ortho(1.0, w, h)

proc initializeApp(app: App, ctx: Frag) =
  logDebug "Initializing app..."
  
  app.eventHandler = AppEventHandler()
  app.eventHandler.init(resize)

  init_space()

  app.assetIds = initTable[string, Hash]()

  let filename = "textures/test01.png"

  logDebug "Loading assets..."
  app.assetIds.add(filename, ctx.assets.load(filename, AssetType.Texture))
  logDebug "Assets loaded."


  tex = assets.get[Texture](ctx.assets, app.assetIds["textures/test01.png"])

  app.camera = Camera()
  app.camera.init(0)
  app.camera.ortho(1.0, 960, 540)

  app.batch = SpriteBatch(
    blendSrcFunc: BlendFunc.SrcAlpha,
    blendDstFunc: BlendFunc.InvSrcAlpha,
    blendingEnabled: true
  )
  app.batch.init(1000, 0)
  logDebug "App initialized."

proc updateApp(app:App, ctx: Frag, deltaTime: float) =
  app.camera.update()
  app.batch.setProjectionMatrix(app.camera.combined)

  space.step(deltaTime)

proc draw_dot(body: Body; data: pointer) {.cdecl.} =
  let batch = cast[SpriteBatch](data)
  batch.draw(tex, body.position.x, body.position.y , 1.5, 1.5)

proc renderApp(app: App, ctx: Frag, deltaTime: float) =
  ctx.graphics.clearView(0, ClearMode.Color.ord or ClearMode.Depth.ord, 0x303030ff, 1.0, 0)
  app.batch.begin()
  space.eachBody(draw_dot, cast[pointer](app.batch))
  app.batch.`end`()
  

proc shutdownApp(app: App, ctx: Frag) =
  logDebug "Shutting down app..."
  
  logDebug "Unloading assets..."
  for _, assetId in app.assetIds:
    ctx.assets.unload(assetId)
  logDebug "Assets unloaded."
  
  app.batch.dispose()
  logDebug "App shut down."

startFrag[App](Config(
  rootWindowTitle: "Frag Example 06-physics",
  rootWindowPosX: window.posUndefined, rootWindowPosY: window.posUndefined,
  rootWindowWidth: 960, rootWindowHeight: 540,
  resetFlags: ResetFlag.VSync,
  logFileName: "example-00.log",
  assetRoot: "../assets",
  debugMode: BGFX_DEBUG_TEXT
))